import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import './NewPage.css';

const NewPage = () => {
  const navigate = useNavigate();

  const newItems = {
    barter: [
      { 
        id: 1, 
        name: 'MacBook Pro M2', 
        price: '$1899', 
        description: 'Latest Apple MacBook with M2 chip, 512GB SSD',
        image: 'https://images.unsplash.com/photo-1517336714731-489689fd1ca8?w=500&auto=format'
      },
      { 
        id: 2, 
        name: 'Dell XPS 15', 
        price: '$1599', 
        description: 'Intel i9, 32GB RAM, 1TB SSD, RTX 3050',
        image: 'https://images.unsplash.com/photo-1593642632823-8f785ba67e45?w=500&auto=format'
      },
      { 
        id: 3, 
        name: 'iPad Pro', 
        price: '$999', 
        description: 'M1 chip, 11-inch, 256GB, Space Gray',
        image: 'https://images.unsplash.com/photo-1544244015-0df4b3ffc6b0?w=500&auto=format'
      },
      { 
        id: 4, 
        name: 'Surface Laptop 5', 
        price: '$1299', 
        description: 'Intel i7, 16GB RAM, 512GB SSD',
        image: 'https://images.unsplash.com/photo-1496181133206-80ce9b88a853?w=500&auto=format'
      },
      { 
        id: 5, 
        name: 'ROG Zephyrus', 
        price: '$2199', 
        description: 'Gaming Laptop, RTX 4070, 1TB SSD',
        image: 'https://images.unsplash.com/photo-1525547719571-a2d4ac8945e2?w=500&auto=format'
      }
    ],
    gadgets: [
      { 
        id: 1, 
        name: 'iPhone 14 Pro', 
        price: '$999', 
        description: 'A16 Bionic, 256GB, Deep Purple',
        image: 'https://images.unsplash.com/photo-1592899677977-9c10ca588bbd?w=500&auto=format'
      },
      { 
        id: 2, 
        name: 'Samsung S23 Ultra', 
        price: '$1199', 
        description: '512GB, 200MP Camera, S Pen',
        image: 'https://images.unsplash.com/photo-1610945265064-0e34e5519bbf?w=500&auto=format'
      },
      { 
        id: 3, 
        name: 'AirPods Pro 2', 
        price: '$249', 
        description: 'Active Noise Cancellation, MagSafe',
        image: 'https://images.unsplash.com/photo-1588423771073-b8903fbb85b5?w=500&auto=format'
      },
      { 
        id: 4, 
        name: 'Sony WH-1000XM5', 
        price: '$399', 
        description: 'Wireless Noise Cancelling Headphones',
        image: 'https://images.unsplash.com/photo-1505740420928-5e560c06d30e?w=500&auto=format'
      },
      { 
        id: 5, 
        name: 'DJI Mini 3 Pro', 
        price: '$759', 
        description: 'Lightweight Drone with 4K Camera',
        image: 'https://images.unsplash.com/photo-1473968512647-3e447244af8f?w=500&auto=format'
      }
    ]
  };

  return (
    <div className="new-page">
      <nav className="navbar">
        <div className="nav-left">
          <button className="back-button" onClick={() => navigate('/home')}>‹</button>
          <ul className="nav-links">
            <li><a onClick={() => navigate('/clothes')}>Clothes</a></li>
            <li><a onClick={() => navigate('/gadgets')}>Gadgets</a></li>
            <li><a onClick={() => navigate('/new')}>New</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#barter">Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button"><FaUser /></button>
        </div>
      </nav>

      <div className="content-wrapper">
        <section className="new-section barter">
          <h2>New in Barter</h2>
          <div className="items-grid">
            {newItems.barter.map(item => (
              <div key={item.id} className="item-card">
                <div className="item-image">
                  <img src={item.image} alt={item.name} />
                </div>
                <h3>{item.name}</h3>
                <p>{item.description}</p>
                <span className="price">{item.price}</span>
              </div>
            ))}
          </div>
        </section>

        <section className="new-section gadgets">
          <h2>New in Gadgets</h2>
          <div className="items-grid">
            // In your map function where you render products
            {newItems.map(item => (
              <div key={item.id} className="product-card" onClick={() => navigate(`/product/${item.id}`)}>
                <img src={item.image} alt={item.name} />
                <h3>{item.name}</h3>
                <p>{item.price}</p>
                <button className="details-button">See Details</button>
              </div>
            ))}
          </div>
        </section>
      </div>
    </div>
  );
};

export default NewPage;
